import React from 'react';
import Header from "../components/Header/Header";
import Aside from "../components/Asside/Aside";
import MinHeader from "../components/MiniHeader/MinHeader";

const Home = () => {
  return (
    <div>
        <Header />
        <div className="flex">
            <Aside />
            <MinHeader />
        </div>
    </div>
  );
};

export default Home;
